import React from 'react';
import logo from './logo.svg';
import './App.css';
import faker from 'faker';
import CommentDetail from './CommentDetail';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className={'ui container comments'}>
            <CommentDetail image={ faker.image.avatar() } author={'Sam'} timeStamp={faker.date.past()} />
            <CommentDetail image={ faker.image.avatar() } author={'Bill'} imeStamp={faker.date.past()} />
            <CommentDetail image={ faker.image.avatar() } author={'Kathy'} imeStamp={faker.date.past()} />
        </div>
      </header>
    </div>
  );
}

export default App;
